W3TOTALCACHE/~3/3ls41y0DNZI/opting-out-of-object-caching-for-certain-objects\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"Thu, 01 Oct 2015 09:59:10 PDT\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:37:\"7494075@http://wordpress.org/support/\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:873:\"<p>Greetings, </p>\n<p>I am trying to determine a way in which the cache automatically clears when a page or specific object/plugin/application is updated in our Wordpress page. I ask because whenever, I update certain content, the changes do not appear, even when clearing browser cache. It is then that I have to empty the caches within W3TC. </p>\n<p>Is it possible to have the cache empty automatically whenever any object/page/data is updated? If not, then what steps can I take to assure that whenever a change is made, it automatically appears. For some pages, its fine, but for others not as much.</p>\n<p>Hope it helps.</p>\n<p><a rel=\"nofollow\" target=\"_blank\" href=\"http://wordpress.org/plugins/w3-total-cache/\">http://wordpress.org/plugins/w3-total-cache/</a>\n</p><img src=\"http://feeds.feedburner.com/~r/W3TOTALCACHE/~4/3ls41y0DNZI\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:97:\"http://wordpress.org/support/topic/opting-out-of-object-caching-for-certain-objects#post-7494075\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:89:\"Homika on &quot;Recently an error occurred while creating the CSS / JS minify cache&quot;\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:127:\"http://feedproxy.google.com/~r/W3TOTALCACHE/~3/u3ifsCU0gyU/recently-an-error-occurred-while-creating-the-css-js-minify-cache-10\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"Wed, 30 Sep 2015 09:00:12 PDT\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:37:\"7489392@http://wordpress.org/support/\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:731:\"<p>I have exactly the same problem. \"admin-bar-button\" plugin was disabled and then deleted but I still get the following error: </p>\n<p>\"Recently an error occurred while creating the CSS / JS minify cache: File \"/home/enjoyyourcooking.com/wp-content/plugins/admin-bar-button/adminBar-front.css\" doesn\'t exist.\"</p>\n<p><a rel=\"nofollow\" target=\"_blank\" href=\"http://s14.postimg.org/743dgj31t/Screen_Shot_2015_09_30_at_11_56_06_AM.png\">Screenshot</a></p>\n<p>Tried flashing cache, playing with settings of W3 Total Cache. This file is not mentioned in any W3 Total Cache settings. Nothing helps. How can I get rid off this error?\n</p><img src=\"http://feeds.feedburner.com/~r/W3TOTALCACHE/~4/u3ifsCU0gyU\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:117:\"http://wordpress.org/support/topic/recently-an-error-occurred-while-creating-the-css-js-minify-cache-10#post-7489392\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:87:\"Norbertjmx on &quot;How to configure W3 Total Cache and Cloudflare in a right way&quot;\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:120:\"http://feedproxy.google.com/~r/W3TOTALCACHE/~3/N1_dmRDg5sg/how-to-configure-w3-total-cache-and-cloudflare-in-a-right-way\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"Wed, 30 Sep 2015 02:07:53 PDT\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:37:\"7487666@http://wordpress.org/support/\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:852:\"<p>Hey Rakesh,</p>\n<p>Have you checked out these tutorials on cloudflare? They might help you.</p>\n<p><a rel=\"nofollow\" target=\"_blank\" href=\"http://support.cloudflare.com/hc/en-us/articles/200169756-Can-I-use-WordPress-caching-plugins-like-Super-Cache-or-W3-Total-Cache-W3TC-with-CloudFlare-\">http://support.cloudflare.com/hc/en-us/articles/200169756-Can-I-use-WordPress-caching-plugins-like-Super-Cache-or-W3-Total-Cache-