DROP TABLE IF EXISTS `arabic_prli_clicks`;
CREATE TABLE `arabic_prli_clicks` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `ip` varchar(255) DEFAULT NULL,
  `browser` varchar(255) DEFAULT NULL,
  `btype` varchar(255) DEFAULT NULL,
  `bversion` varchar(255) DEFAULT NULL,
  `os` varchar(255) DEFAULT NULL,
  `referer` varchar(255) DEFAULT NULL,
  `host` varchar(255) DEFAULT NULL,
  `uri` varchar(255) DEFAULT NULL,
  `robot` tinyint(4) DEFAULT '0',
  `first_click` tinyint(4) DEFAULT '0',
  `created_at` datetime NOT NULL,
  `link_id` int(11) DEFAULT NULL,
  `vuid` varchar(25) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `link_id` (`link_id`),
  KEY `ip` (`ip`),
  KEY `browser` (`browser`),
  KEY `btype` (`btype`),
  KEY `bversion` (`bversion`),
  KEY `os` (`os`),
  KEY `referer` (`referer`),
  KEY `host` (`host`),
  KEY `uri` (`uri`),
  KEY `robot` (`robot`),
  KEY `first_click` (`first_click`),
  KEY `vuid` (`vuid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `arabic_prli_groups`;
CREATE TABLE `arabic_prli_groups` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `description` text COLLATE utf8mb4_unicode_ci,
  `created_at` datetime NOT NULL,
  `post_id` int(15) NOT NULL,
  `job_id` int(15) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `name` (`name`(191)),
  KEY `indx_post_id_job_id` (`post_id`,`job_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `arabic_prli_links`;
CREATE TABLE `arabic_prli_links` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `description` text COLLATE utf8mb4_unicode_ci,
  `url` text COLLATE utf8mb4_unicode_ci,
  `slug` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `nofollow` tinyint(1) DEFAULT '0',
  `track_me` tinyint(1) DEFAULT '1',
  `param_forwarding` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `param_struct` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `redirect_type` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT '307',
  `created_at` datetime NOT NULL,
  `group_id` int(11) DEFAULT NULL,
  `cellno` varchar(20) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `post_id` int(111) DEFAULT NULL,
  `job_id` int(111) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `group_id` (`group_id`),
  KEY `name` (`name`(191)),
  KEY `nofollow` (`nofollow`),
  KEY `track_me` (`track_me`),
  KEY `param_forwarding` (`param_forwarding`(191)),
  KEY `param_struct` (`param_struct`(191)),
  KEY `redirect_type` (`redirect_type`(191)),
  KEY `slug` (`slug`(191)),
  KEY `index_cellno` (`cellno`),
  KEY `indx_job_id` (`job_id`),
  KEY `indx_post_id` (`post_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `arabic_prli_link_metas`;
CREATE TABLE `arabic_prli_link_metas` (
