3TOTALCACHE/~3/3ls41y0DNZI/opting-out-of-object-caching-for-certain-objects\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"Thu, 01 Oct 2015 09:59:10 PDT\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:37:\"7494075@http://wordpress.org/support/\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:873:\"<p>Greetings, </p>\n<p>I am trying to determine a way in which the cache automatically clears when a page or specific object/plugin/application is updated in our Wordpress page. I ask because whenever, I update certain content, the changes do not appear, even when clearing browser cache. It is then that I have to empty the caches within W3TC. </p>\n<p>Is it possible to have the cache empty automatically whenever any object/page/data is updated? If not, then what steps can I take to assure that whenever a change is made, it automatically appears. For some pages, its fine, but for others not as much.</p>\n<p>Hope it helps.</p>\n<p><a rel=\"nofollow\" target=\"_blank\" href=\"http://wordpress.org/plugins/w3-total-cache/\">http://wordpress.org/plugins/w3-total-cache/</a>\n</p><img src=\"http://feeds.feedburner.com/~r/W3TOTALCACHE/~4/3ls41y0DNZI\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:97:\"http://wordpress.org/support/topic/opting-out-of-object-caching-for-certain-objects#post-7494075\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6: