(2,	1,	'2017-02-13 12:43:05',	'2017-02-13 12:43:05',	'This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://wp1.dnx.us/utab/arabic/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!',	'Sample Page',	'',	'publish',	'closed',	'open',	'',	'sample-page',	'',	'',	'2017-02-13 12:43:05',	'2017-02-13 12:43:05',	'',	0,	'http://wp1.dnx.us/utab/arabic/?page_id=2',	0,	'page',	'',	0),
(4,	1,	'2017-02-13 12:44:23',	'2017-02-13 12:44:23',	'<p style=\"color:red;font-weight:bold;\">This page and the content has been automatically generated for you to give you a basic idea of how a \"Join Us\" page should look like. You can customize this page however you like it by editing this page from your WordPress page editor.</p><p style=\"font-weight:bold;\">If you end up changing the URL of this page then make sure to update the URL value in the settings menu of the plugin.</p><p style=\"border-top:1px solid #ccc;padding-top:10px;margin-top:10px;\"></p>\r\n			<strong>Free Membership</strong>\r\n			<br />\r\n			You get unlimited access to free membership content\r\n			<br />\r\n			<em><strong>Price: Free!</strong></em>\r\n			<br /><br />Link the following image to go to the Registration Page if you want your visitors to be able to create a free membership account<br /><br />\r\n			<img title=\"Join Now\" src=\"http://wp1.dnx.us/utab/arabic/wp-content/plugins/simple-membership/images/join-now-button-image.gif\" alt=\"Join Now Button\" width=\"277\" height=\"82\" />\r\n			<p style=\"border-bottom:1px solid #ccc;padding-bottom:10px;margin-bottom:10px;\"></p><p><strong>You can register for a Free Membership or pay for one of the following membership options</strong></p><p style=\"border-top:1px solid #ccc;padding-top:10px;margin-top:10px;\"></p>\r\n			[ ==> Insert Payment Button For Your Paid Membership Levels Here <== ]\r\n			<p style=\"border-bottom:1px solid #ccc;padding-bottom:10px;margin-bottom:10px;\"></p>',	'Join Us',	'',	'publish',	'closed',	'closed',	'',	'membership-join',	'',	'',	'2017-02-13 12:44:23',	'2017-02-13 12:44:23',	'',	0,	'http://wp1.dnx.us/utab/arabic/membership-join/',	0,	'page',	'',	0),
