(128,	'_transient_dash_88ae138922fe95674369b1cb3d215a2b',	'<div class=\"rss-widget\"><ul><li><a class=\'rsswidget\' href=\'https://wordpress.org/news/2017/03/wordpress-4-7-3-security-and-maintenance-release/\'>WordPress 4.7.3 Security and Maintenance Release</a> <span class=\"rss-date\">March 6, 2017</span><div class=\"rssSummary\">WordPress 4.7.3 is now available. This is a security release for all previous versions and we strongly encourage you to update your sites immediately. WordPress versions 4.7.2 and earlier are affected by sixÂ security issues: Cross-site scripting (XSS) viaÂ media file metadata. Â Reported by Chris AndrÃ¨ Dale, Yorick Koster,Â and Simon P. Briggs. Control characters can trick redirect [&hellip;]</div></li></ul></div><div class=\"rss-widget\"><ul><li><a class=\'rsswidget\' href=\'https://wptavern.com/uk-home-secretary-amber-rudd-links-wordpress-com-to-the-spread-of-terrorism\'>WPTavern: UK Home Secretary Amber Rudd Links WordPress.com to the Spread of Terrorism</a></li><li><a class=\'rsswidget\' href=\'https://wptavern.com/wordcamp-miami-2017-will-livestream-all-sessions-this-weekend\'>WPTavern: WordCamp Miami 2017 Will Livestream All Sessions this Weekend</a></li><li><a class=\'rsswidget\' href=\'https://wptavern.com/medium-aims-to-fix-broken-media-with-new-5-subscription-program\'>WPTavern: Medium Aims to Fix âBrokenâ Media with New $5 Subscription Program</a></li></ul></div><div class=\"rss-widget\"><ul><li class=\"dashboard-news-plugin\"><span>Popular Plugin:</span> WooCommerce&nbsp;<a href=\"plugin-install.php?tab=plugin-information&amp;plugin=woocommerce&amp;_wpnonce=a97d7632be&amp;TB_iframe=true&amp;width=600&amp;height=800\" class=\"thickbox open-plugin-details-modal\" aria-label=\"Install WooCommerce\">(Install)</a></li></ul></div>',	'no'),
